import React from 'react';

function Footer() {
    const css = `
    .my {
        position:absolute;
        left:0;
        bottom:0;
        right:0;        
        background-color: #89CFF0;
    }
    `
    return (
        <div class="my">
            <style>{css}</style>
            <p class="my">sponsored by googlemetaamazonandyourmom</p>
        </div>
    )
}

export default Footer;
